query:
SELECT COUNT(*) as total_properties FROM properties;
SELECT 
  COUNT(*) as duplicate_count
FROM (
  SELECT 
    CONCAT(addressLine1, ', ', city, ', ', state, ' ', zipcode) as fullAddress
  FROM properties
  GROUP BY addressLine1, city, state, zipcode
  HAVING COUNT(*) > 1
) as duplicates;

